INSERT INTO `sys_operate_log` VALUES (169, 'a1c0ba70-a99a-4fd1-8cdb-beca51ca4b4c', 1, '代码生成器 API', '基于 SQL 建表语句，创建代码生成器的表和字段定义', 2, '', '', 'POST', '/api/tool/codegen/create-list-from-sql', '127.0.0.1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_14_6) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/88.0.4324.96 Safari/537.36', 'CommonResult cn.iocoder.dashboard.modules.tool.controller.codegen.ToolCodegenController.createCodegenListFromSQL(String)', '{\"sql\":\"CREATE TABLE `sys_file` (\\n  `id` varchar(255) NOT NULL COMMENT \'文件路径\',\\n  `content` blob NOT NULL COMMENT \'文件内容\',\\n  `create_by` varchar(64) DEFAULT \'\' COMMENT \'创建者\',\\n  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\\n  `update_by` varchar(64) DEFAULT \'\' COMMENT \'更新者\',\\n  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'更新时间\',\\n  `deleted` bit(1) NOT NULL DEFAULT b\'0\' COMMENT \'是否删除\',\\n  PRIMARY KEY (`id`) USING BTREE\\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'文件表\\\\n\';\"}', '2021-02-13 11:43:49', 127, 500, 'IllegalStateException: column(content) 的数据库类型(blob) 找不到匹配的 Java 类型', 'null', '', '2021-02-06 20:28:34', '', '2021-02-06 20:28:34', b'0');
INSERT INTO `sys_operate_log` VALUES (170, '526cf7ed-0c80-4d2e-89e4-0e72a6fe2597', 1, '代码生成器 API', '基于 SQL 建表语句，创建代码生成器的表和字段定义', 2, '', '', 'POST', '/api/tool/codegen/create-list-from-sql', '127.0.0.1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_14_6) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/88.0.4324.96 Safari/537.36', 'CommonResult cn.iocoder.dashboard.modules.tool.controller.codegen.ToolCodegenController.createCodegenListFromSQL(String)', '{\"sql\":\"CREATE TABLE `sys_job` (\\n  `job_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'任务ID\',\\n  `job_name` varchar(64) NOT NULL DEFAULT \'\' COMMENT \'任务名称\',\\n  `job_group` varchar(64) NOT NULL DEFAULT \'DEFAULT\' COMMENT \'任务组名\',\\n  `invoke_target` varchar(500) NOT NULL COMMENT \'调用目标字符串\',\\n  `cron_expression` varchar(255) DEFAULT \'\' COMMENT \'cron执行表达式\',\\n  `misfire_policy` varchar(20) DEFAULT \'3\' COMMENT \'计划执行错误策略（1立即执行 2执行一次 3放弃执行）\',\\n  `concurrent` char(1) DEFAULT \'1\' COMMENT \'是否并发执行（0允许 1禁止）\',\\n  `status` char(1) DEFAULT \'0\' COMMENT \'状态（0正常 1暂停）\',\\n  `create_by` varchar(64) DEFAULT \'\' COMMENT \'创建者\',\\n  `create_time` datetime DEFAULT NULL COMMENT \'创建时间\',\\n  `update_by` varchar(64) DEFAULT \'\' COMMENT \'更新者\',\\n  `update_time` datetime DEFAULT NULL COMMENT \'更新时间\',\\n  `remark` varchar(500) DEFAULT \'\' COMMENT \'备注信息\',\\n  PRIMARY KEY (`job_id`,`job_name`,`job_group`)\\n) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COMMENT=\'定时任务调度表\';\"}', '2021-02-13 11:44:41', 85, 0, '', '23', '', '2021-02-06 20:29:26', '', '2021-02-06 20:29:26', b'0');
